import React, { useState, useEffect } from 'react';
import { Outlet } from 'react-router-dom';
import Navbar from './components/Navbar';

function Main() {
  const [fullnames, setFullNames] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3000/data')
      .then((res) => res.json())
      .then((data) => setFullNames(data))
      .catch((error) => console.log(`Your error: ${error}`));
  }, []);

  const filteredNames = fullnames.map((item, index) => (
      <small key={index}>{item.firstname} {item.lastname}<br/></small>
  ));


  return (
    <div>
      <header>
        <Navbar />
      </header>
      <Outlet context={{ filteredNames, setFullNames }} />
    </div>
  );
}

export default Main;
